import { UserNav } from "../../component/Navbar/homeNav"
import { getPrinters } from "../../data/data"
import './Myprinters.css'
import { useNavigate } from "react-router-dom";
import { useEffect,useState} from "react";
import OnBoarding from "../../SmartContracts/OnBoarding/OnBoarding";

export default function MyPrinters(){

    const onBoarding=new OnBoarding();
    const printers=getPrinters();
    const navigate=useNavigate();
    const [printerList,setPr]=useState([]);

    async function getPrinters(){
        let res =await onBoarding.getPrinters();
        let valu=res;

        if(res.length===1)


        valu.map((value,key)=>{
                if(key===0 && printerList.length===1)
                    return;
               setPr((prev)=>[...prev,<tr key={key}>
                    <td key={value.name+"name"}>{value.name}</td>
                    <td key={value.volume+"volume"}>{value.volume}</td>
                    <td key={value.maxPrintTemperature}>{value.maxPrintTemperature}</td>
                </tr>])


        })

    }



    useEffect(()=>{
        getPrinters();
        },[])

    return(
        <div>
             <UserNav/>
            <div className="printerTable">
            <h1>My printers</h1>


            <table className="myPrinters">
                <tbody>
                    <tr>
                        <th>Name</th>
                        <th>Volume</th>
                        <th>Max printer temperature</th>
                    </tr>
                    {printerList} 
                </tbody> 
            </table>


            </div>

        </div>
    )
}








